import React, { useState, useContext } from 'react';
import { AuthContext } from '../context/AuthContext';

const AnnotatorDashboard = () => {
  const { currentUser } = useContext(AuthContext);
  const [annotations, setAnnotations] = useState([]);
  const images = ['/images/image1.jpg', '/images/image2.jpg', '/images/image3.jpg'];
  const [currentImage, setCurrentImage] = useState(0);

  const handleAnnotation = (annotation) => {
    setAnnotations([...annotations, { image: images[currentImage], annotation }]);
    if (currentImage < images.length - 1) {
      setCurrentImage(currentImage + 1);
    } else {
      alert('All images annotated!');
    }
  };

  return (
    <div>
      <h2>Annotator Dashboard</h2>
      <p>Welcome, {currentUser.email}</p>
      <img src={images[currentImage]} alt="for annotation" />
      <button onClick={() => handleAnnotation('Annotation 1')}>Annotate 1</button>
      <button onClick={() => handleAnnotation('Annotation 2')}>Annotate 2</button>
    </div>
  );
};

export default AnnotatorDashboard;
